from collections import defaultdict

def solution(msg):
    answer = []
    last_index = 27
    index = defaultdict(int)

    for x in range(1, 27):
        index[chr(x + 64)] = x

    msg_idx = 0

    while msg_idx < len(msg):

        cnt = 1
        while msg_idx + cnt <= len(msg) and\
                    msg[msg_idx:msg_idx + cnt] in index:
            cnt += 1

        now_sentence = msg[msg_idx : msg_idx + cnt - 1]
        new_sentence = msg[msg_idx : msg_idx + cnt]

        answer.append(index[now_sentence])

        if new_sentence == now_sentence:
            break

        if new_sentence not in index:
            index[new_sentence] = last_index
            last_index += 1
            msg_idx = msg_idx + cnt - 1
        else :
            msg_idx += 1

    return answer

print(solution("KAKAO"))
print(solution("TOBEORNOTTOBEORTOBEORNOT"))

